IF OBJECT_ID('dbo.proc_transform_272', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_272;
GO
CREATE PROCEDURE dbo.proc_transform_272
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_272
    SET payload = LEFT(payload, 1000) + N'|V4-272|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_272;
END
